import './App.css';

function App() {
  const personOne = {
    name: "Bob",
    age: 21
  }
  function increasePerson(person){
    const updatedPerson = Object.assign({}, person)
    updatedPerson.age += 1
    return updatedPerson
  }

  const updatedPersonOne = increasePerson(personOne)
  console.log(personOne.age);
  console.log(updatedPersonOne.age);

